import React from "react";

import "../../index.css";
import LandingPageNavbar from "./sections/LandingPageNavbar";
import Me from "../../assets/me.jpeg";
import { Col, Row, Jumbotron } from "react-bootstrap";
import { Link } from "react-router-dom";

const LandingPage = () => {
  return (
    <Col>
      <LandingPageNavbar/>
      <div className="mt-5">
        <div className="full">
          <div className="d-flex flex-row">
            <Col md="4">
              <img
                className="img-fluid langing-img"
                src={Me}
                alt="hi"
                style={{
                  borderTopLeftRadius: "50px",
                  borderBottomLeftRadius: "50px"
                }}
              />
            </Col>
            <Col md="8">
              <h2 className="h2-responsive mt-3 mb-2">404. That's an error.</h2>
              <h4>The requested URL was not found on this server.</h4>
            </Col>
            <Link to="/">Back to Home</Link>
          </div>
        </div>
        {/* <Jumbotron>
  <h1>Hello, world!</h1>
  <p>
    This is a simple hero unit, a simple jumbotron-style component for calling
    extra attention to featured content or information.
  </p>

</Jumbotron> */}
      </div>
      {/* <div className="logo-wrapper waves-effect">
          <img
            className="img-fluid langing-img"
            src={Me}
            alt="hi"
            style={{
              borderTopLeftRadius: "50px",
              borderBottomLeftRadius: "50px"
            }}
          />
        </div> */}
    </Col>
  );
};

export default LandingPage;
